import React, {Component} from 'react'
import './ToDoList.css'

class ToDoList extends Component{

    constructor(){
        super();

        this.state({
            lists: []
        })
    }

    render(){
        return(
            <h1>ToDoList</h1>
        );
    }
}

export default ToDoList;
